import React from 'react';
import { ReactDOM } from 'react-dom';

import axios from 'axios';

const App = () => {
    return (
        <div id="app">
            <div id="search">
                <h3>Look up players here...</h3>
                <form>
                    <input type="text" placeholder="player search" />
                    <button type="submit">Search</button>
                </form>
            </div>
            <div id="results">
                <h3>Here's what was found:</h3>
            </div>
            <div id="lineup">
                <h3>Your roster so far:</h3>
            </div>
        </div>
    )
}

ReactDOM.render(
    <App />,
    document.getElementById('root')
);
